# Função para verificar se as colunas são iguais entre os dois grupos
def check_columns_equality(num_imputers, numerical_transformers):
    imputer_set = set(num_imputers)
    transformer_set = set(numerical_transformers)

    # Comparação entre os dois conjuntos
    are_equal = imputer_set == transformer_set

    # Encontrar diferenças
    only_in_imputer = imputer_set - transformer_set
    only_in_transformer = transformer_set - imputer_set

    return are_equal, only_in_imputer, only_in_transformer


